    	<div style={ {display:'flex',  alignItems: 'normal',
    				justifyContent: 'center' ,color: 'rgba(150, 20, 160, 0.7)'}} >
      	<input type="checkbox" /> </div>
		<h9 style={ {display:'flex',  alignItems: 'normal',
    				justifyContent: 'center' ,color: 'rgba(150, 20, 160, 0.7)'}} >    Completed:  {dateComleted}</h9>
    </div>
  );
}
